            <nav className="justify-content-center">

                <NavLink to="/"><h1>Home</h1></NavLink> <span>&nbsp;&nbsp;&nbsp;&nbsp;</span>

                <NavLink to="/landlords"><h1>Landlords</h1></NavLink> <span>&nbsp;&nbsp;&nbsp;&nbsp;</span>

                <NavLink to="/landlords/new"><h1>Create Landlord</h1></NavLink> <span>&nbsp;&nbsp;&nbsp;&nbsp;</span>

            </nav>
        )
    }
}

const mapStateToProps = state => {
    return {
        landlord: state.landlords.landlords
    }
}

export default connect(mapStateToProps)(Navbar)
